import React, { useState, useEffect } from 'react';
import { Container, Row, Col, Nav, Tab, Table, Badge, Spinner } from 'react-bootstrap';
import axios from 'axios';

const DataViewer = () => {
  const [registrations, setRegistrations] = useState([]);
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchData = async () => {
      setLoading(true);
      try {
        const [regResponse, orderResponse] = await Promise.all([
          axios.get('/api/ucc-registrations'),
          axios.get('/api/orders')
        ]);
        
        setRegistrations(regResponse.data.data || []);
        setOrders(orderResponse.data.data || []);
      } catch (error) {
        console.error('Error fetching data:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  return (
    <Container className="mt-4">
      <h2>Database Records</h2>
      
      <Tab.Container defaultActiveKey="registrations">
        <Row>
          <Col sm={3}>
            <Nav variant="pills" className="flex-column">
              <Nav.Item>
                <Nav.Link eventKey="registrations">UCC Registrations</Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link eventKey="orders">Orders</Nav.Link>
              </Nav.Item>
            </Nav>
          </Col>
          <Col sm={9}>
            <Tab.Content>
              <Tab.Pane eventKey="registrations">
                {loading ? (
                  <div className="text-center my-4">
                    <Spinner animation="border" role="status">
                      <span className="visually-hidden">Loading...</span>
                    </Spinner>
                  </div>
                ) : (
                  <Table striped bordered hover responsive>
                    <thead>
                      <tr>
                        <th>Client Code</th>
                        <th>Status</th>
                        <th>Timestamp</th>
                        <th>Details</th>
                      </tr>
                    </thead>
                    <tbody>
                      {registrations.length > 0 ? (
                        registrations.map((reg) => (
                          <tr key={reg._id}>
                            <td>{reg.clientCode}</td>
                            <td>
                              <Badge bg={reg.status === 'SUCCESS' ? 'success' : 'danger'}>
                                {reg.status}
                              </Badge>
                            </td>
                            <td>{new Date(reg.timestamp).toLocaleString()}</td>
                            <td>
                              <details>
                                <summary>View Response</summary>
                                <pre style={{maxHeight: '200px', overflow: 'auto'}}>
                                  {JSON.stringify(reg.response, null, 2)}
                                </pre>
                              </details>
                            </td>
                          </tr>
                        ))
                      ) : (
                        <tr>
                          <td colSpan="4" className="text-center">No registrations found</td>
                        </tr>
                      )}
                    </tbody>
                  </Table>
                )}
              </Tab.Pane>
              <Tab.Pane eventKey="orders">
                {loading ? (
                  <div className="text-center my-4">
                    <Spinner animation="border" role="status">
                      <span className="visually-hidden">Loading...</span>
                    </Spinner>
                  </div>
                ) : (
                  <Table striped bordered hover responsive>
                    <thead>
                      <tr>
                        <th>Client Code</th>
                        <th>Scheme</th>
                        <th>Type</th>
                        <th>Amount</th>
                        <th>Status</th>
                        <th>Date</th>
                        <th>Details</th>
                      </tr>
                    </thead>
                    <tbody>
                      {orders.length > 0 ? (
                        orders.map((order) => (
                          <tr key={order._id}>
                            <td>{order.clientCode}</td>
                            <td>{order.schemeCode}</td>
                            <td>{order.transactionType === 'P' ? 'Purchase' : 'Redemption'}</td>
                            <td>â‚¹{order.orderAmount}</td>
                            <td>
                              <Badge bg={order.status === 'SUCCESS' ? 'success' : 'danger'}>
                                {order.status}
                              </Badge>
                            </td>
                            <td>{new Date(order.timestamp).toLocaleString()}</td>
                            <td>
                              <details>
                                <summary>View Response</summary>
                                <pre style={{maxHeight: '200px', overflow: 'auto'}}>
                                  {JSON.stringify(order.response, null, 2)}
                                </pre>
                              </details>
                            </td>
                          </tr>
                        ))
                      ) : (
                        <tr>
                          <td colSpan="7" className="text-center">No orders found</td>
                        </tr>
                      )}
                    </tbody>
                  </Table>
                )}
              </Tab.Pane>
            </Tab.Content>
          </Col>
        </Row>
      </Tab.Container>
    </Container>
  );
};

export default DataViewer;
